import React from "react";
import styled from "styled-components";

import { CatCard } from "./petsList/CatCard";

const CatsListContainer = styled.section`
  display: flex;
  justify-content: center;
  margin-top: 56px;
`;

const List = styled.section`
  width: 100%;
`;

export const CatsList = ({ pets }) => (
  <CatsListContainer>
    <List>
      {pets.map(pet => (
        <CatCard key={pet.name} pet={pet} />
      ))}
    </List>
  </CatsListContainer>
);
